use strict;
use lib "/httpd/modules";

use CDB_File;

use Data::Dumper;
#print Dumper(zips());
unlink "/httpd/static/zips.cdb";
my $t = new CDB_File("/httpd/static/zips.cdb","t.$$") or die ("could not open zips.cdb");

my $ref = zips();
my $i = 0;
foreach my $k (keys %{$ref}) {
	print "K: $k\n";
	$i++;
	$t->insert($k,$ref->{$k});
	}
$t->finish();
$t = undef;
chmod 0666, "/httpd/static/zips.cdb";
if (! -f "/httpd/static/zips.cdb") {
	die("could not generate file!\n");
	}
print "Did $i zip codes\n";
print "Now push:\n";
print "/httpd/static/zips.cdb\n";


